import React, { useEffect, useState } from 'react'
import { useSelector } from 'react-redux'

const Users = async () => {
  const users = useSelector(store => store.users)
  return(
    <div>
      {users.map(user => {
        {user.userName}
      })}
    </div>
  )
}

export default Users
